import React, { useState } from "react";
import myVideo from "./videos/heropage_video.mp4";
import logo from "./videos/icon3.jpg"; // Import the logo image

const Home = () => {
  const [isWindowVisible, setIsWindowVisible] = useState(false); // State to show/hide the small window

  const containerStyle = {
    position: "relative",
    width: "100vw",
    height: "100vh",
    overflow: "hidden",
    color: "#fff",
  };

  const videoStyle = {
    position: "absolute",
    top: 0,
    left: 0,
    width: "100%",
    height: "100%",
    objectFit: "cover",
    zIndex: -1,
  };

  const logoStyle = {
    height: "40px", // Adjust the size of the logo
    width: "auto",
  };

  const overlayStyle = {
    position: "absolute",
    top: 0,
    left: 0,
    width: "100%",
    height: "100%",
    backgroundColor: "rgba(12, 8, 8, 0.8)", // Adjust the opacity
    zIndex: 0,
  };

  const navStyle = {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    padding: "10px 20px",
    backgroundColor: "rgba(0, 0, 0, 0.6)",
    position: "fixed",
    top: 0,
    width: "100%",
    zIndex: 10,
    height: "70px",
    fontFamily: "Arial, sans-serif",
    boxSizing: "border-box",
  };

  const navItemStyle = {
    color: "#fff",
    fontSize: "16px",
    fontWeight: "bold",
    textDecoration: "none",
    margin: "0 15px",
    cursor: "pointer",
    padding: "8px 12px",
    borderRadius: "5px",
    transition: "all 0.3s ease",
  };

  const contactStyle = {
    ...navItemStyle,
    backgroundColor: "yellow",
    color: "#000",
    fontWeight: "bold",
  };

  const leftContentStyle = {
    position: "absolute",
    top: "30%",
    left: "10%",
    textAlign: "left",
    maxWidth: "400px",
  };

  const headingStyle = {
    fontSize: "48px",
    marginTop: "250px",
    color: "#fff",
    lineHeight: "1",
    textAlign: "left",
  };

  const subHeadingStyle = {
    fontSize: "18px",
    lineHeight: "1.2",
    marginBottom: "20px",
    color: "#ddd",
  };

  const buttonContainerStyle = {
    display: "flex",
    gap: "15px",
  };

  const buttonStyle = {
    padding: "15px 25px",
    fontSize: "16px",
    fontWeight: "bold",
    color: "#fff",
    backgroundColor: "#007BFF",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
    transition: "background-color 0.3s ease",
  };

  const buttonStyleAlt = {
    ...buttonStyle,
    backgroundColor: "transparent",
    border: "2px solid #007BFF",
  };

  const smallWindowStyle = {
    position: "absolute",
    top: "40%",
    left: "50%",
    transform: "translate(-50%, -50%)",
    backgroundColor: "black",
    padding: "20px",
    borderRadius: "10px",
    textAlign: "center",
    color: "white",
    boxShadow: "0 4px 8px rgba(0, 0, 0, 0.2)",
    zIndex: 30,
    width: "300px",
  };

  const outsideButtonStyle = {
    padding: "10px 20px",
    fontSize: "14px",
    fontWeight: "bold",
    border: "none",
    borderRadius: "5px",
    cursor: "pointer",
  };

  return (
    <div style={containerStyle}>
      {/* Background Video */}
      <video style={videoStyle} src={myVideo} autoPlay loop muted />

      {/* Overlay to darken the video */}
      <div style={overlayStyle}></div>

      <nav style={navStyle}>
        <div>
          <img src={logo} alt="Logo" style={logoStyle} /> AIFBF
        </div>
        <div style={{ display: "flex" }}>
          {["Home", "About", "Sectors", "Leadership", "Contact"].map(
            (item) => (
              <span
                key={item}
                style={item === "Contact" ? contactStyle : navItemStyle}
              >
                {item}
              </span>
            )
          )}
        </div>
      </nav>

      {/* Left Content */}
      <div style={leftContentStyle}>
        <h2 style={headingStyle}>
          Advocating for Financial <br /> Inclusion and Borrower <br />
          Empowerment
        </h2>
        <p style={subHeadingStyle}>
          We're committed to creating a more equitable financial system where
          everyone has access to fair lending practices and opportunities for
          financial growth.
        </p>
        <div style={buttonContainerStyle}>
          <button style={buttonStyle} onClick={() => setIsWindowVisible(true)}>
            Get Started
          </button>
          <button style={buttonStyleAlt}>Learn More</button>
        </div>
      </div>

      {/* Small Window */}
      {isWindowVisible && (
        <div style={smallWindowStyle}>
          <h3>Welcome to AIFBF</h3>
          <p>
            Explore our features to empower borrowers and achieve financial
            growth. We're excited to have you here.
          </p>
          <div>
            <button
              style={{ ...outsideButtonStyle, backgroundColor: "#007BFF" }}
              onClick={() => alert("Sign Up process started!")}
            >
              Sign Up Now
            </button>
            <button
              style={{ ...outsideButtonStyle, backgroundColor: "#ddd" }}
              onClick={() => setIsWindowVisible(false)}
            >
              Maybe Later
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default Home;
